uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters
uniform float u_speed;
uniform float u_scale;
uniform float u_sparkle;
uniform float u_glow;
uniform float u_hue;   // Bottom Start Color
uniform float u_hue2;  // Top Start Color

out vec4 fragColor;

// --- Helper Functions ---

float hash(vec2 p) {
    p = fract(p * vec2(123.34, 456.21));
    p += dot(p, p + 45.32);
    return fract(p.x * p.y);
}

// HSB to RGB Conversion
vec3 hsb2rgb(vec3 c) {
    vec3 rgb = clamp(abs(mod(c.x * 6.0 + vec3(0.0, 4.0, 2.0), 6.0) - 3.0) - 1.0, 0.0, 1.0);
    rgb = rgb * rgb * (3.0 - 2.0 * rgb);
    return c.z * mix(vec3(1.0), rgb, c.y);
}

// Dual-Hue Palette Logic
vec3 getLayerColor(int i, float hue1, float hue2) {
    // Normalize layer index (0 to 9) to range 0.0 to 1.0
    float t = float(i) / 9.0; 

    // Mix the two hues based on layer height
    // We use a "shortest path" mix logic implicitly by handling fract() outside
    float h = mix(hue1, hue2, t);

    // Saturation: Bottom layers (0) are rich, Top layers (1) are slightly paler
    float sat = mix(1.0, 0.5, t);

    // Brightness: Bottom layers are dark, Top layers are bright
    float bri = mix(0.3, 1.0, t);

    // Ensure hue wraps correctly 0.0-1.0
    return hsb2rgb(vec3(fract(h), sat, bri));
}

float getDust(vec2 uv, float t) {
    float gridSize = 25.0; 
    vec2 id = floor(uv * gridSize);
    vec2 f = fract(uv * gridSize);
    float r = hash(id);
    vec2 pos = vec2(r, fract(r * 12.34));
    float d = distance(f, pos);
    float size = 0.03 * (0.5 + 0.5 * sin(t * 2.0 + r * 15.0));
    return smoothstep(size, size * 0.5, d) * r; 
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec2 uv0 = uv;

    // Safety Fallbacks for Params
    float spd = (u_speed <= 0.0) ? 0.3 : u_speed;
    float time = iTime * spd;
    float scale = (u_scale <= 0.0) ? 1.0 : u_scale;
    float sparkleInt = (u_sparkle <= 0.0) ? 1.0 : u_sparkle;
    float glowInt = (u_glow <= 0.0) ? 1.5 : u_glow;

    // --- 5 Minute Cycle Logic ---
    // 300.0 seconds = 5 minutes. 
    // This value goes from 0.0 to 1.0 over 5 minutes.
    float cycle = iTime / 300.0;

    // Get Base Hues from sliders (Default to Orange/Purple offset if 0)
    float baseHue1 = (u_hue == 0.0) ? 0.05 : u_hue; 
    float baseHue2 = (u_hue2 == 0.0) ? 0.75 : u_hue2;

    // Add the time cycle to the user selection
    // fract() ensures it loops smoothly when it passes 1.0
    float hue1 = fract(baseHue1 + cycle);
    float hue2 = fract(baseHue2 + cycle);

    // Background: Dark blend of the two current hues
    // We mix the shortest distance between hues for the background
    float bgHue = fract(mix(hue1, hue2, 0.5));
    vec3 bgCol = hsb2rgb(vec3(bgHue, 0.8, 0.02));
    vec3 finalColor = bgCol;

    // Loop 10 times for 10 layers
    for(int i = 0; i < 10; i++) {

        float layerIndex = float(i);

        // --- Wave Logic ---
        float waveHeight = sin(uv.x * (1.5 + layerIndex * 0.1) + time + layerIndex) * 0.3; 
        waveHeight += sin(uv.x * 4.0 - time * 1.2 + layerIndex) * 0.05; 
        waveHeight *= scale;

        float yOffset = -0.7 + (layerIndex * 0.15); 
        float surfaceY = waveHeight + yOffset;

        // Mask
        float fillMask = smoothstep(0.01, -0.01, uv.y - surfaceY);

        // Glow
        float edgeDist = abs(uv.y - surfaceY);
        float edgeGlow = exp(-edgeDist * 10.0) * glowInt;

        // --- Color Logic ---
        // We pass the animated hues here
        vec3 col = getLayerColor(i, hue1, hue2);

        // --- Sparkles ---
        vec2 dustUV = uv;
        dustUV.x -= time * 0.1 + (layerIndex * 0.03); 
        float sparkles = getDust(dustUV + vec2(layerIndex, 0.0), time);

        // --- Composition ---
        finalColor += col * fillMask * 0.15; 
        finalColor += col * edgeGlow * 0.5; 

        vec3 sparkleCol = mix(col, vec3(1.0), 0.8);
        finalColor += sparkleCol * sparkles * fillMask * sparkleInt;
    }

    // Vignette
    finalColor *= 1.2 - length(uv0) * 0.5;
    finalColor = smoothstep(-0.02, 1.2, finalColor);

    fragColor = vec4(finalColor, 1.0);
}

